{"data_series_issue_identification_fra": "N72d53mW110d11m_2", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N72d53mW110d11m_2", "data_series_issue_identification": "N72d53mW110d11m_2", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "group": "nrcan-rncan", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[72.867044, -110.35147], [72.885599, -110.350788], [72.885388, -110.287776], [72.866834, -110.288524], [72.867044, -110.35147]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W110/N72/N72d53mW110d11m_2.gtif", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W110/N72/N72d53mW110d11m_2.tfw", "language": "no language | aucune langue", "format": "TIFF World File"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W110/N72/N72d53mW110d11m_2.tif", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W110/N72/N72d53mW110d11m_2.summary", "language": "no language | aucune langue", "format": "text"}], "browse_graphic_url": "", "topic_category": "Location  Localisation", "tags": [{"name": "Geomatics  G\u00e9omatique"}, {"name": "Geographic data  Donn\u00e9es g\u00e9ographiques"}, {"name": "Photography  Photographie"}, {"name": "Aerial photography  Photographie a\u00e9rienne"}, {"name": "Imagery and Basemaps  Imagerie et carte de base"}, {"name": "GCP  BDPC"}, {"name": "Air photo  Photo a\u00e9rienne"}, {"name": "Ground Control Points  Points dappui au sol"}, {"name": "NTS 78B14  SNRC 78B14"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1969-12-31", "time_period_coverage_start": "", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "data_series_name": "Ground Control Database, Canada", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "0007097e-8afb-5f83-993b-9979aecf7984", "language": "", "url": "", "notes": "The Ground Control Database (GCDB) is a collection of geo-corrected aerial photo images (or chips) developed for the GIS and remote sensing community. The database provides accurate and useful information obtained from corrected aerial photos. This database can be used by the end-user as a fundamental data source for correction and validation of satellite, vector and raster data, as well as for map correcting and updating, analysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N72d53mW110d11m_2", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer - 075I13", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer", "group": "nrcan-rncan", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Les fichiers CanMatrix - Pr\u00eat \u00e0 imprimer ont \u00e9t\u00e9 produits \u00e0 partir des cartes topographiques publi\u00e9es par le Gouvernement du Canada. Ces fichiers sont bas\u00e9s sur le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) et disponibles aux \u00e9chelles de 1/50 000 et 1/250 000. Chaque fichier ou jeu de donn\u00e9es CanMatrix - Pr\u00eat \u00e0 imprimer contient l'ensemble de l'information figurant au recto de la carte topographique. Cela comprend l'information topographique incluse \u00e0 l'int\u00e9rieur de l'orle cartographique de m\u00eame que l'habillage de la carte, soit l'information situ\u00e9e en p\u00e9riph\u00e9rie de l'orle cartographique.  Les donn\u00e9es contenues dans ce fichier CanMatrix - Pr\u00eat \u00e0 imprimer proviennent du balayage d'une carte topographique papier monochrome (noir et blanc).  Suite au balayage initial de la carte papier, ce fichier a \u00e9t\u00e9 inspect\u00e9 et class\u00e9 \" Provisoire\". Ce fichier inclut un filigrane \"Impression provisoire\" au bas du coin inf\u00e9rieur gauche de la carte. La qualit\u00e9 des impressions provisoire varie grandement. Un certain nombre d'op\u00e9rations de nettoyage, d\u00e9coupage, mise \u00e0 l'\u00e9chelle et ajustement des tons et couleurs peuvent \u00eatre n\u00e9cessaires afin d'am\u00e9liorer la qualit\u00e9 de l'impression.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-106, 62.75], [-106, 63], [-105.5, 63], [-105.5, 62.75], [-106, 62.75]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/075/i/canmatrix2_075i13_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/075/i/canmatrix2_075i13_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/075/i/canmatrix2_075i13_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/075/i/canmatrix2_075i13_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANMATRIX2075I131.0  CANMATRIX2075I131.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "BODIE LAKE  BODIE LAKE"}, {"name": "075I13  075I13"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2008-07-21", "time_period_coverage_start": "1987", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "CanMatrix - Print Ready", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1987", "name": "0007827a-8fbb-475e-bd61-b99a819e9fa3", "language": "", "url": "", "notes": "CanMatrix - Print Ready files were produced from topographic maps published by the Government of Canada, and correspond to the National Topographic System (NTS) grid at 1:50 000 and 1:250 000 scales. Each CanMatrix - Print Ready file or dataset contains all of the information shown on the front of the topographic map, including the topographic information within the neatline of the map, and the information in the border of the map outside of the neatline.  This CanMatrix - Print Ready file was produced by scanning a monochrome (black and white) paper topographic map.  Following initial scanning of the paper map, the digital file was inspected and classified as \"Provisional\". This file includes a \"Provisional Print\" watermark in the bottom left corner of the map. The printing quality of Provisional Prints varies greatly. Varying amounts of cleaning, trimming, scaling, and shade/colour adjustment may be required to improve the print quality.", "title": "CanMatrix - Print Ready - 075I13", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "GEOBASE_2.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada - 075L14", "data_series_issue_identification": "GEOBASE_2.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Donn\u00e9es num\u00e9riques d'\u00e9l\u00e9vation du Canada", "group": "nrcan-rncan", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "SupportGeoBase@nrcan.gc.ca", "geographic_region": "", "notes_fra": "Le Centre d'information topographique (CIT) produit les DNEC de concert avec des organismes f\u00e9d\u00e9raux, provinciaux et territoriaux ainsi qu'avec le secteur priv\u00e9.   Les DNEC consistent en un tableau ordonn\u00e9 de valeurs d'\u00e9l\u00e9vation au sol ou de surface (enregistr\u00e9es en m\u00e8tres) interpol\u00e9es \u00e0 des points r\u00e9guli\u00e8rement espac\u00e9s. Les donn\u00e9es sources num\u00e9riques des DNEC peuvent \u00eatre extraites des \u00e9l\u00e9ments hypsographiques et hydrographiques de la Base nationale de donn\u00e9es topographiques (BNDT) aux \u00e9chelles de 1/50 000 et 1/250 000, ou de la Base de donn\u00e9es g\u00e9ospatiales (BDG), ou de donn\u00e9es de position, \u00e0 diverses \u00e9chelles, acquises des provinces et territoires ou d'imageries de t\u00e9l\u00e9d\u00e9tection.", "presentation_form": "Model Digital | Mod\u00e8le num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-111.5, 62.75], [-111.5, 63], [-111, 63], [-111, 62.75], [-111.5, 62.75]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/50k_dem/075/075l14.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geobase/official/cded/50k_dem/075/075l14.zip", "language": "no language | aucune langue", "format": "CDED ASCII"}], "browse_graphic_url": "", "topic_category": "Elevation  \u00c9l\u00e9vation", "tags": [{"name": "CDED075L141.0  DNEC075L141.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "075L14  075L14"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1946", "spatial_representation_type": "Model Digital | Mod\u00e8le num\u00e9rique", "data_series_name": "Canadian Digital Elevation Data", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1946", "name": "0007a010-556d-4f83-bb8e-6e22dcc62e84", "language": "", "url": "", "notes": "The Centre for Topographic Information (CTI) jointly produces the CDED with federal, provincial and territorial government agencies as well as the private sector.   A CDED consists of an ordered array of ground or reflective surface elevations, recorded in metres, at regularly spaced intervals. The source digital data for CDED is extracted from the hypsographic and hydrographic elements of the National Topographic Data Base (NTDB) at scales of 1:50,000 and 1:250,000, or the Geospatial Data Base (GDB), or various scaled positional data acquired by the provinces and territories, or remotely sensed imagery.", "title": "Canadian Digital Elevation Data - 075L14", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "3.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base nationale de donn\u00e9es topographiques (BNDT) - 116G14", "data_series_issue_identification": "3.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base nationale de donn\u00e9es topographiques (BNDT)", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Cette collection est maintenant statique. Les utilisateurs actuels de la Base nationale de donn\u00e9es topographiques (BNDT) devraient envisager de faire la transition vers le produit CanVec. La Base nationale de donn\u00e9es topographiques (BNDT) est compos\u00e9e de donn\u00e9es num\u00e9riques vectorielles qui couvrent l'ensemble du territoire canadien. En num\u00e9risant et en structurant des milliers de cartes topographiques, G\u00e9omatique Canada a con\u00e7u un produit homog\u00e8ne et complet, fort utile dans une multitude de secteurs d'activit\u00e9s. La BNDT comprend des \u00e9l\u00e9ments comme les cours d'eau, les zones urbaines, les r\u00e9seaux ferroviaire et routier, la v\u00e9g\u00e9tation et le relief. La BNDT utilise comme unit\u00e9 organisationnelle le d\u00e9coupage r\u00e9gulier du Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC), lui-m\u00eame bas\u00e9 sur le Syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1983 (NAD83). Chaque fichier (jeu de donn\u00e9es) repr\u00e9sente une unit\u00e9 du SNRC \u00e0 l'\u00e9chelle de 1/50 000. Les donn\u00e9es num\u00e9riques sont repr\u00e9sent\u00e9es par des points, des lignes et des surfaces.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[65.7499964, -139.00001173], [65.749995, -139.25002189], [65.7499976, -139.50000975], [65.9999986, -139.50001437], [65.9999987, -139.25000518], [65.9999969, -139.00001791], [65.7499964, -139.00001173]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/116/g/bndt_116g14_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/116/g/bndt_116g14_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/116/g/bndt_116g14_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/116/g/bndt_116g14_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "NTDB116G143.1  BNDT116G143.1"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "Designated area  Aires d\u00e9sign\u00e9es"}, {"name": "Road  Chemin"}, {"name": "Manmade features  Constructions"}, {"name": "Relief and Landforms  Relief et formes"}, {"name": "Hydrography  Hydrographie"}, {"name": "Hypsography  Hypsographie"}, {"name": "ToponymyPlace Names  ToponymieNoms de lieux"}, {"name": "Electric Network  R\u00e9seau \u00e9lectrique"}, {"name": "Railroad Network  R\u00e9seau f\u00e9rroviaire"}, {"name": "Road Network  R\u00e9seau routier"}, {"name": "Water Saturated Soils  Sols satur\u00e9s deau"}, {"name": "Vegetation  V\u00e9g\u00e9tation"}, {"name": "MOUNT FOWLIE  MOUNT FOWLIE"}, {"name": "116G14  116G14"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1951-09", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "National Topographic Data Base (NTDB)", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1979", "name": "0007bed0-dae1-4da5-b155-577a4315f232", "language": "", "url": "", "notes": "This collection is static now. Current users of the National Topographic Data Base (NTDB) should plan to make the transition towards CanVec product. The National Topographic Data Base (NTDB) comprises digital vector data sets that cover the entire Canadian landmass. Geomatics Canada has digitized and structured thousands of topographic maps, creating a complete and uniform product that can be highly useful in a broad range of industries. The NTDB includes features such as watercourses, urban areas, railways, roads, vegetation, and relief.The organizational unit for the NTDB is the National Topographic System (NTS), based on the North American Datum of 1983 (NAD83). Each file (data set) consists of one NTS unit at the 1:50,000 scale. The ground data is depicted through points, lines, and areas.", "title": "National Topographic Data Base (NTDB) - 116G14", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
