{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanImage - Landsat 7 Orthoimages of Canada, 1:50 000 - 094D07", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanImage - Landsat 7 Orthoimages of Canada, 1:50 000", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Le produit CanImage est une image matricielle contenant de l'information provenant des ortho-images Landsat 7 r\u00e9\u00e9chantillonn\u00e9es et d\u00e9coup\u00e9es selon le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) \u00e0 l'\u00e9chelle de 1/50 000 dans la projection UTM. Ce produit est distribu\u00e9 par fichier dans le format GeoTIFF. La r\u00e9solution de ce produit est de 15 m\u00e8tres. Les ortho-images Landsat 7 contiennent 8 bandes spectrales. Pour la cr\u00e9ation du produit CanImage, les bandes 3 (rouge), 2 (verte) et 1 (verte-bleue) ont \u00e9t\u00e9 retenues. Ces bandes sont repr\u00e9sent\u00e9es par les couleurs rouge (bande 3), verte (bande 2) et bleue (bande 1). Un rehaussement lin\u00e9aire est effectu\u00e9 sur chacune des 3 bandes spectrales afin d'am\u00e9liorer le contraste des donn\u00e9es. Le d\u00e9coupage du produit selon le SNRC dans la projection UTM g\u00e9n\u00e8re un chevauchement entre les fichiers CanImage adjacents.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-127, 56.25], [-127, 56.5], [-126.5, 56.5], [-126.5, 56.25], [-127, 56.25]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canimage/50k/094/d/canimage_094d07_tif.zip", "language": "no language | aucune langue", "format": "GeoTIF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canimage/50k/094/d/canimage_094d07_tif.zip", "language": "no language | aucune langue", "format": "GeoTIF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANIMAGE094D071.0  CANIMAGE094D071.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "National imagery  Imagerie nationale"}, {"name": "ASITKA RIVER  ASITKA RIVER"}, {"name": "094D07  094D07"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "2002-07-07", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "data_series_name": "CanImage - Ortho-images Landsat 7 du Canada, 1/50 000", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "2002-07-07", "name": "00084379-2cf6-44a8-91d6-aa8c022fca37", "language": "", "url": "", "notes": "CanImage is a raster image containing information from Landsat 7 orthoimages that have been resampled and based on the National Topographic System (NTS) at the 1:50 000 scale in the UTM projection. The product is distributed in files in GeoTIFF format. The resolution of this product is 15 metres. The Landsat 7 ortho images contain 8 spectral bands. For the creation of the CanImage product, the following bands were retained: band 3 (red), 2 (green) and 1 (green-blue). These bands are displayed using the colors: red (band 3), green (band 2) and blue (band 1). A linear stretching is done on each of the 3 band in order to increase the contrast. The clipping of the product according to the NTS in the UTM projection generate an overlap between the adjacent CanImage data sets.", "title": "CanImage - Ortho-images Landsat 7 du Canada, 1/50 000 - 094D07", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "1.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanTopo - 059E03", "data_series_issue_identification": "1.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanTopo", "group": "nrcan-rncan", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "CanTopo est la nouvelle g\u00e9n\u00e9ration de cartes topographiques produites par Ressources naturelles Canada. Ce produit cartographique num\u00e9rique provient des meilleures sources de donn\u00e9es disponibles couvrant le territoire canadien et offre un produit cartographique de qualit\u00e9 en formats vectoriel et matriciel qui est conforme aux normes g\u00e9omatiques internationales.  CanTopo est un produit de sources multiples g\u00e9n\u00e9r\u00e9 \u00e0 partie de la Base de donn\u00e9es cartographique (BDC) d\u00e9crite dans les Sp\u00e9cifications de produit de la Base de donn\u00e9es cartographiques. Les donn\u00e9es de la BDC proviennent principalement de l'initiative G\u00e9oBase (www.geobase.ca), des donn\u00e9es topographiques num\u00e9riques de Ressources naturelles Canada et de donn\u00e9es d'initiatives nationales. Des donn\u00e9es de sources faisant autorit\u00e9 telles que provenant d'autres agences gouvernementales autant f\u00e9d\u00e9rales que provinciales, sont utilis\u00e9es entrepos\u00e9es et identifi\u00e9es.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-91, 78], [-91, 78.25], [-90, 78.25], [-90, 78], [-91, 78]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_pdf/059/e/cantopo_059e03_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_pdf/059/e/cantopo_059e03_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_geopdf/059/e/cantopo_059e03_geopdf.zip", "language": "no language | aucune langue", "format": "GeoPDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_geopdf/059/e/cantopo_059e03_geopdf.zip", "language": "no language | aucune langue", "format": "GeoPDF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_tif/059/e/cantopo_059e03_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_tif/059/e/cantopo_059e03_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_geotiff/059/e/cantopo_059e03_geotiff.zip", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/cantopo/50k_geotiff/059/e/cantopo_059e03_geotiff.zip", "language": "no language | aucune langue", "format": "GeoTIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANTOPO059E031.0  CANTOPO059E031.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "Science Keywords BIOSPHERE VEGETATION  Mots-cl\u00e9s scientifiques biosph\u00e8re v\u00e9g\u00e9tation"}, {"name": "Administratives Boundaries  Limites administratives"}, {"name": "Buildings and Structures  B\u00e2timents et structures"}, {"name": "Energy  \u00c9nergie"}, {"name": "Hydrography  Hydrographie"}, {"name": "Industrial and Commercial Areas  Zones industrielles et commerciales"}, {"name": "Places of Interest  Lieux dint\u00e9r\u00eats"}, {"name": "Relief and Landforms  Relief et formes"}, {"name": "ToponymyPlace Names  ToponymieNoms de lieux"}, {"name": "Water Saturated Soils  Sols satur\u00e9s deau"}, {"name": "059E03  059E03"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1959-07-28", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "CanTopo", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1959-07-28", "name": "00085803-3b0e-47a7-a0ea-34b495b34e55", "language": "", "url": "", "notes": "CanTopo is the next generation of topographic maps being produced by Natural Resources Canada. This digital cartographic product originates from the best available data sources covering the Canadian territory and offers a quality cartographic product in vector and raster format that complies with international geomatics standards.  CanTopo is a multi-source product generated from the Cartographic Data Base (CDB) described in the Cartographic Data Base (CDB) Product Specification. Data within the CDB comes mainly from the GeoBase initiative (www.geobase.ca), Natural Resources Canada digital topographic data and data from national initiatives. Data from authoritative sources, such as other government agencies both federal and provincial, are identified, stored, and used.", "title": "CanTopo - 059E03", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
