{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer - 043M13", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer", "group": "nrcan-rncan", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Les fichiers CanMatrix - Pr\u00eat \u00e0 imprimer ont \u00e9t\u00e9 produits \u00e0 partir des cartes topographiques publi\u00e9es par le Gouvernement du Canada. Ces fichiers sont bas\u00e9s sur le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) et disponibles aux \u00e9chelles de 1/50 000 et 1/250 000. Chaque fichier ou jeu de donn\u00e9es CanMatrix - Pr\u00eat \u00e0 imprimer contient l'ensemble de l'information figurant au recto de la carte topographique. Cela comprend l'information topographique incluse \u00e0 l'int\u00e9rieur de l'orle cartographique de m\u00eame que l'habillage de la carte, soit l'information situ\u00e9e en p\u00e9riph\u00e9rie de l'orle cartographique.  Les donn\u00e9es contenues dans ce fichier CanMatrix - Pr\u00eat \u00e0 imprimer proviennent du balayage d'une orthophoto carte topographique papier.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-88, 55.75], [-88, 56], [-87.5, 56], [-87.5, 55.75], [-88, 55.75]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/043/m/canmatrix2_043m13_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/043/m/canmatrix2_043m13_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/043/m/canmatrix2_043m13_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/043/m/canmatrix2_043m13_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANMATRIX2043M131.0  CANMATRIX2043M131.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "SUGAR ISLAND  SUGAR ISLAND"}, {"name": "043M13  043M13"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1976", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "CanMatrix - Print Ready", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1976", "name": "00094fc8-0263-43d1-858d-86e820d0cfc6", "language": "", "url": "", "notes": "CanMatrix - Print Ready files were produced from topographic maps published by the Government of Canada, and correspond to the National Topographic System (NTS) grid at 1:50 000 and 1:250 000 scales. Each CanMatrix - Print Ready file or dataset contains all of the information shown on the front of the topographic map, including the topographic information within the neatline of the map, and the information in the border of the map outside of the neatline.  This CanMatrix - Print Ready file was produced by scanning a paper orthophoto topographic map.", "title": "CanMatrix - Print Ready - 043M13", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "1,1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanMatrix - g\u00e9or\u00e9f\u00e9renc\u00e9 - 001K", "data_series_issue_identification": "1,1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanMatrix - g\u00e9or\u00e9f\u00e9renc\u00e9", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Ce fichier CanMatrix (g\u00e9or\u00e9f\u00e9renc\u00e9) est un produit compos\u00e9 de donn\u00e9es matricielles r\u00e9sultant du balayage de la carte papier \u00e0 l'\u00e9chelle de 1/250 000. La source du fichier matriciel (carte papier) est g\u00e9ocod\u00e9e dans le Syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1927 (NAD27).  Le fichier matriciel r\u00e9sultant est g\u00e9ocod\u00e9 selon la projection Universelle transverse de Mercator (UTM). Le jeu de donn\u00e9es est disponible dans le format G\u00e9oTIFF.  Le Centre d'information topographique d\u00e9sire mettre en place l'\u00e9quivalent d'une base de donn\u00e9es nationale continue de cartes matricielles o\u00f9 chaque pixel poss\u00e8de une situation g\u00e9ographique distincte.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-54, 46], [-54, 47], [-52, 47], [-52, 46], [-54, 46]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix/250k_300dpi/001/k/canmatrix_001k_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix/250k_300dpi/001/k/canmatrix_001k_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANMATRIX001K1.1  CANMATRIX001K1.1"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "TREPASSEY  TREPASSEY"}, {"name": "001K  001K"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1979", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "CanMatrix - georeferenced", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1979", "name": "000a283f-2c24-4030-b06c-0be2787649e9", "language": "", "url": "", "notes": "This CanMatrix (georeferenced) file is composed of raster data from the scanned map at the 1:250 000 scale. The source of this raster file (paper map) is geocoded according to the North American Datum of 1927 (NAD27).  The resulting raster file is georeferenced to the North American Datum of 1983 (NAD 83) according to the Universal Transverse Mercator (UTM) projection. This product is distributed in GeoTIFF.  The Centre for Topographic Information wants to create a national database composed of raster map data where each pixel has a distinct geographic location (georeferenced data).", "title": "CanMatrix - georeferenced - 001K", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
