{"data_series_issue_identification_fra": "N63d39mW118d24m_1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N63d39mW118d24m_1", "data_series_issue_identification": "N63d39mW118d24m_1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "group": "nrcan-rncan", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[63.646697, -118.316826], [63.665268, -118.317687], [63.66563, -118.277595], [63.647058, -118.27676], [63.646697, -118.316826]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W118/N63/N63d39mW118d24m_1.gtif", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W118/N63/N63d39mW118d24m_1.tfw", "language": "no language | aucune langue", "format": "TIFF World File"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W118/N63/N63d39mW118d24m_1.tif", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W118/N63/N63d39mW118d24m_1.summary", "language": "no language | aucune langue", "format": "text"}], "browse_graphic_url": "", "topic_category": "Location  Localisation", "tags": [{"name": "Geomatics  G\u00e9omatique"}, {"name": "Geographic data  Donn\u00e9es g\u00e9ographiques"}, {"name": "Photography  Photographie"}, {"name": "Aerial photography  Photographie a\u00e9rienne"}, {"name": "Imagery and Basemaps  Imagerie et carte de base"}, {"name": "GCP  BDPC"}, {"name": "Air photo  Photo a\u00e9rienne"}, {"name": "Ground Control Points  Points dappui au sol"}, {"name": "NTS 85M9  SNRC 85M9"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1980-06-28", "time_period_coverage_start": "", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "data_series_name": "Ground Control Database, Canada", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "000af8f3-ab86-548e-ba5d-d6a425f5c702", "language": "", "url": "", "notes": "The Ground Control Database (GCDB) is a collection of geo-corrected aerial photo images (or chips) developed for the GIS and remote sensing community. The database provides accurate and useful information obtained from corrected aerial photos. This database can be used by the end-user as a fundamental data source for correction and validation of satellite, vector and raster data, as well as for map correcting and updating, analysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N63d39mW118d24m_1", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "3.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base nationale de donn\u00e9es topographiques (BNDT) - 056P01", "data_series_issue_identification": "3.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base nationale de donn\u00e9es topographiques (BNDT)", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Cette collection est maintenant statique. Les utilisateurs actuels de la Base nationale de donn\u00e9es topographiques (BNDT) devraient envisager de faire la transition vers le produit CanVec. La Base nationale de donn\u00e9es topographiques (BNDT) est compos\u00e9e de donn\u00e9es num\u00e9riques vectorielles qui couvrent l'ensemble du territoire canadien. En num\u00e9risant et en structurant des milliers de cartes topographiques, G\u00e9omatique Canada a con\u00e7u un produit homog\u00e8ne et complet, fort utile dans une multitude de secteurs d'activit\u00e9s. La BNDT comprend des \u00e9l\u00e9ments comme les cours d'eau, les zones urbaines, les r\u00e9seaux ferroviaire et routier, la v\u00e9g\u00e9tation et le relief. La BNDT utilise comme unit\u00e9 organisationnelle le d\u00e9coupage r\u00e9gulier du Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC), lui-m\u00eame bas\u00e9 sur le Syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1983 (NAD83). Chaque fichier (jeu de donn\u00e9es) repr\u00e9sente une unit\u00e9 du SNRC \u00e0 l'\u00e9chelle de 1/50 000. Les donn\u00e9es num\u00e9riques sont repr\u00e9sent\u00e9es par des points, des lignes et des surfaces.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[66.9999967, -88.00000229], [66.9999966, -88.24999898], [66.9999985, -88.49998939], [67.2499977, -88.49999478], [67.2499955, -88.25000358], [67.2499987, -88.00000615], [66.9999967, -88.00000229]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/056/p/bndt_056p01_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/056/p/bndt_056p01_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/056/p/bndt_056p01_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/056/p/bndt_056p01_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "NTDB056P015.0  BNDT056P015.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "Designated area  Aires d\u00e9sign\u00e9es"}, {"name": "Road  Chemin"}, {"name": "Manmade features  Constructions"}, {"name": "Relief and Landforms  Relief et formes"}, {"name": "Hydrography  Hydrographie"}, {"name": "Hypsography  Hypsographie"}, {"name": "ToponymyPlace Names  ToponymieNoms de lieux"}, {"name": "Electric Network  R\u00e9seau \u00e9lectrique"}, {"name": "Railroad Network  R\u00e9seau f\u00e9rroviaire"}, {"name": "Road Network  R\u00e9seau routier"}, {"name": "Water Saturated Soils  Sols satur\u00e9s deau"}, {"name": "Vegetation  V\u00e9g\u00e9tation"}, {"name": "056P01  056P01"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1956-09", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "National Topographic Data Base (NTDB)", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "2001-09", "name": "000b55a3-6dc8-49ff-bfb3-70e9e4fd2ee9", "language": "", "url": "", "notes": "This collection is static now. Current users of the National Topographic Data Base (NTDB) should plan to make the transition towards CanVec product. The National Topographic Data Base (NTDB) comprises digital vector data sets that cover the entire Canadian landmass. Geomatics Canada has digitized and structured thousands of topographic maps, creating a complete and uniform product that can be highly useful in a broad range of industries. The NTDB includes features such as watercourses, urban areas, railways, roads, vegetation, and relief.The organizational unit for the NTDB is the National Topographic System (NTS), based on the North American Datum of 1983 (NAD83). Each file (data set) consists of one NTS unit at the 1:50,000 scale. The ground data is depicted through points, lines, and areas.", "title": "National Topographic Data Base (NTDB) - 056P01", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
