{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Ortho-image Landsat 7 d\u00e9coup\u00e9e par SNRC au 1:50 000 - 085J03", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Ortho-image Landsat 7 d\u00e9coup\u00e9e par SNRC au 1:50 000", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Le produit CanImage est une image matricielle contenant de l'information provenant des ortho-images Landsat 7 r\u00e9\u00e9chantillonn\u00e9es et d\u00e9coup\u00e9es selon le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) \u00e0 l'\u00e9chelle de 1/50 000 dans la projection UTM. Ce produit est distribu\u00e9 par fichier dans le format GeoTIFF. La r\u00e9solution de ce produit est de 15 m\u00e8tres. Les ortho-images Landsat 7 contiennent 8 bandes spectrales. Pour la cr\u00e9ation du produit CanImage, les bandes 3 (rouge), 2 (verte) et 1 (verte-bleue) ont \u00e9t\u00e9 retenues. Ces bandes sont repr\u00e9sent\u00e9es par les couleurs rouge (bande 3), verte (bande 2) et bleue (bande 1). Un rehaussement lin\u00e9aire est effectu\u00e9 sur chacune des 3 bandes spectrales afin d'am\u00e9liorer le contraste des donn\u00e9es. Le d\u00e9coupage du produit selon le SNRC dans la projection UTM g\u00e9n\u00e8re un chevauchement entre les fichiers CanImage adjacents.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-115.5, 62], [-115.5, 62.25], [-115, 62.25], [-115, 62], [-115.5, 62]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canimage/50k/085/j/canimage_085j03_tif.zip", "language": "no language | aucune langue", "format": "GeoTIF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canimage/50k/085/j/canimage_085j03_tif.zip", "language": "no language | aucune langue", "format": "GeoTIF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANIMAGE085J031.6  CANIMAGE085J031.6"}, {"name": "Earth Science  Earth Science"}, {"name": "Sciences de la Terre  Sciences de la Terre"}, {"name": "National imagery  National imagery"}, {"name": "Imagerie nationale  Imagerie nationale"}, {"name": "MCIVER BAY  MCIVER BAY"}, {"name": "085J03  085J03"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "2001-09-28", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "data_series_name": "Landsat 7 Orthoimage tiled by NTS 1/50000", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "2001-09-28", "name": "000ccf12-5f47-44d1-ba25-f6ab36d168dd", "language": "", "url": "", "notes": "CanImage is a raster image containing information from Landsat 7 orthoimages that have been resampled and based on the National Topographic System (NTS) at the 1:50 000 scale in the UTM projection. The product is distributed in files in GeoTIFF format. The resolution of this product is 15 metres. The Landsat 7 ortho images contain 8 spectral bands. For the creation of the CanImage product, the following bands were retained: band 3 (red), 2 (green) and 1 (green-blue). These bands are displayed using the colors: red (band 3), green (band 2) and blue (band 1). A linear stretching is done on each of the 3 band in order to increase the contrast. The clipping of the product according to the NTS in the UTM projection generate an overlap between the adjacent CanImage data sets.", "title": "Landsat 7 Orthoimage tiled by NTS 1/50000 - 085J03", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "2.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Matrices de correction de la BNDT - 056M14", "data_series_issue_identification": "2.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Matrices de correction de la BNDT", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Les matrices de correction de la Base nationale de donn\u00e9es topographiques (BNDT), aussi connu sous l'acronyme MATCOR, sont un produit d\u00e9riv\u00e9 du rehaussement planim\u00e9trique des jeux de donn\u00e9es de la BNDT \u00e0 l'\u00e9chelle de 1/50 000. La matrice de correction permet \u00e0 l'utilisateur d'am\u00e9liorer la pr\u00e9cision g\u00e9om\u00e9trique des donn\u00e9es moins pr\u00e9cises de la BNDT. La matrice est un ensemble de points r\u00e9partis sur une grille r\u00e9guli\u00e8re aux 100 m\u00e8tres, chaque point d\u00e9crivant les corrections planim\u00e9triques (DX, DY) \u00e0 apporter \u00e0 cet endroit. La position des points est en coordonn\u00e9es UTM (projection universelle transverse de Mercator) selon le syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1983 (NAD83). Chaque fichier forme une zone rectangulaire recouvrant en son entier le jeu de donn\u00e9es de la BNDT associ\u00e9. Son d\u00e9coupage correspond donc grossi\u00e8rement au Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) \u00e0 l'\u00e9chelle de 1/50 000. Tous les jeux de donn\u00e9es de la BNDT \u00e0 l'\u00e9chelle de 1/50 000, dont la pr\u00e9cision originale est inf\u00e9rieure \u00e0 30 m\u00e8tres, devraient \u00eatre corrig\u00e9s g\u00e9om\u00e9triquement en utilisant des ortho-images Landsat comme r\u00e9f\u00e9rence spatiale. Le jeu de donn\u00e9es MATCOR contient une liste de coordonn\u00e9es et les corrections correspondantes \u00e0 appliquer sous la forme : X Y DX DY.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-95.5, 67.75], [-95.5, 68], [-95, 68], [-95, 67.75], [-95.5, 67.75]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/matcor/056/m/matcor_056m14.zip", "language": "no language | aucune langue", "format": "ASCII"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/matcor/056/m/matcor_056m14.zip", "language": "no language | aucune langue", "format": "ASCII"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "MAT-CORR-BNDT-L7056M141.1  MAT-CORR-BNDT-L7056M141.1"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "Science Keywords HYDROSPHERE SURFACE WATER  Mots-cl\u00e9s scientifiques hydrosph\u00e8re eau de surface"}, {"name": "Science Keywords LAND SURFACE TOPOGRAPHY  Mots-cl\u00e9s scientifiques surface terrestre topographie"}, {"name": "Science Keywords BIOSPHERE VEGETATION  Mots-cl\u00e9s scientifiques biosph\u00e8re v\u00e9g\u00e9tation"}, {"name": "056M14  056M14"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "2000-09-03", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "NTDB Correction Matrices", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "2000-09-03", "name": "000cdeb9-981c-4de3-8104-3634ee2fc9c7", "language": "", "url": "", "notes": "The correction matrices for the National Topographic Data Base (NTDB), also known under the acronym CORMAT, are products derived from the planimetric enhancement of NTDB data sets at the 1:50 000 scale. The correction matrix enables users to enhance the geometric accuracy of the less accurate NTDB. The matrix is a set of points arrayed on a regular 100-m grid. Each point describes the planimetric correction (DX, DY) to be applied at this location. The position of the points is given in UTM (Universal Transverse Mercator projection) coordinates based on the North American Datum of 1983 (NAD83). Each file constitutes a rectangular area covering the entire corresponding NTDB data set. Its delimitation corresponds more or less to National Topographic System (NTS) divisions at the 1:50 000 scale. All NTDB data sets at the 1:50 000 scale whose original accuracy was less than 30 m should be geometrically corrected by using the Landsat orthoimage as a spatial reference. A CORMAT data set contains a list of coordinates and the corresponding corrections to be applied in the form X Y DX DY.", "title": "NTDB Correction Matrices - 056M14", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "N60d19mW103d45m_3", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base de donn\u00e9es des points d'appui au sol, Canada - N60d19mW103d45m_3", "data_series_issue_identification": "N60d19mW103d45m_3", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base de donn\u00e9es des points d'appui au sol, Canada", "group": "nrcan-rncan", "maintenance_and_update_frequency": "", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "La Base de donn\u00e9es des points d'appui au sol (BDPAS) est une collection d'orthophotographies (ou chips) destin\u00e9e aux utilisateurs de SIG et de t\u00e9l\u00e9d\u00e9tection. La base de donn\u00e9es fournit une information utile et exacte \u00e9tablie \u00e0 partir de photos a\u00e9riennes corrig\u00e9es. L'utilisateur final peut s'y reporter \u00e0 titre de source de donn\u00e9es fondamentales pour corriger et valider les donn\u00e9es satellitaires, vectorielles et matricielles, pour fins de correction et de mise \u00e0 jour des cartes ainsi que d'analyse, de mod\u00e9lisation et de traitement des images. La BDPAS a d'abord \u00e9t\u00e9 constitu\u00e9e pour suppl\u00e9er au traitement et/ou \u00e0 la correction des donn\u00e9es LANDSAT et SPOT afin d'offrir des produits d'imagerie satellitaire \u00e0 valeur ajout\u00e9e. G\u00e9ogratis offre maintenant \u00e0 l'utilisateur final la possibilit\u00e9 d'acc\u00e9der \u00e0 ces donn\u00e9es en ligne de mani\u00e8re efficace et \u00e9conomique.", "presentation_form": "Image Digital | Image num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[60.363672, -103.751638], [60.382253, -103.750927], [60.381896, -103.713392], [60.363315, -103.714125], [60.363672, -103.751638]]]}", "license_id": "", "resources": [{"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W103/N60/N60d19mW103d45m_3.gtif", "language": "no language | aucune langue", "format": "GeoTIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W103/N60/N60d19mW103d45m_3.tfw", "language": "no language | aucune langue", "format": "TIFF World File"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W103/N60/N60d19mW103d45m_3.tif", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/geott/eo_imagery/gcdb/W103/N60/N60d19mW103d45m_3.summary", "language": "no language | aucune langue", "format": "text"}], "browse_graphic_url": "", "topic_category": "Location  Localisation", "tags": [{"name": "Geomatics  G\u00e9omatique"}, {"name": "Geographic data  Donn\u00e9es g\u00e9ographiques"}, {"name": "Photography  Photographie"}, {"name": "Aerial photography  Photographie a\u00e9rienne"}, {"name": "Imagery and Basemaps  Imagerie et carte de base"}, {"name": "GCP  BDPC"}, {"name": "Air photo  Photo a\u00e9rienne"}, {"name": "Ground Control Points  Points dappui au sol"}, {"name": "NTS 65D5  SNRC 65D5"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "1982-07-04", "time_period_coverage_start": "", "spatial_representation_type": "Image Digital | Image num\u00e9rique", "data_series_name": "Ground Control Database, Canada", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "", "name": "000cdfcc-c48f-588b-8f67-90cacabcae10", "language": "", "url": "", "notes": "The Ground Control Database (GCDB) is a collection of geo-corrected aerial photo images (or chips) developed for the GIS and remote sensing community. The database provides accurate and useful information obtained from corrected aerial photos. This database can be used by the end-user as a fundamental data source for correction and validation of satellite, vector and raster data, as well as for map correcting and updating, analysis, modeling, and image processing. The GCDB was initially developed to supplement processing and/or correction of LANDSAT and SPOT data for value added satellite imagery products. Now, through GeoGratis, online access to the GCDB is offered as an efficient and cost effective method of delivery to the end-user.", "title": "Ground Control Database, Canada - N60d19mW103d45m_3", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
