{"data_series_issue_identification_fra": "3.1", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "Base nationale de donn\u00e9es topographiques (BNDT) - 105C14", "data_series_issue_identification": "3.1", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "Base nationale de donn\u00e9es topographiques (BNDT)", "group": "nrcan-rncan", "maintenance_and_update_frequency": "Not Planned | Non planifi\u00e9", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Cette collection est maintenant statique. Les utilisateurs actuels de la Base nationale de donn\u00e9es topographiques (BNDT) devraient envisager de faire la transition vers le produit CanVec. La Base nationale de donn\u00e9es topographiques (BNDT) est compos\u00e9e de donn\u00e9es num\u00e9riques vectorielles qui couvrent l'ensemble du territoire canadien. En num\u00e9risant et en structurant des milliers de cartes topographiques, G\u00e9omatique Canada a con\u00e7u un produit homog\u00e8ne et complet, fort utile dans une multitude de secteurs d'activit\u00e9s. La BNDT comprend des \u00e9l\u00e9ments comme les cours d'eau, les zones urbaines, les r\u00e9seaux ferroviaire et routier, la v\u00e9g\u00e9tation et le relief. La BNDT utilise comme unit\u00e9 organisationnelle le d\u00e9coupage r\u00e9gulier du Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC), lui-m\u00eame bas\u00e9 sur le Syst\u00e8me de r\u00e9f\u00e9rence nord-am\u00e9ricain de 1983 (NAD83). Chaque fichier (jeu de donn\u00e9es) repr\u00e9sente une unit\u00e9 du SNRC \u00e0 l'\u00e9chelle de 1/50 000. Les donn\u00e9es num\u00e9riques sont repr\u00e9sent\u00e9es par des points, des lignes et des surfaces.", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[60.7499913, -133.00000427], [60.7499925, -133.25000819], [60.7499947, -133.50001303], [60.9999984, -133.50001569], [60.9999945, -133.25000801], [60.999994, -133.00000101], [60.7499913, -133.00000427]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/105/c/bndt_105c14_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_en/105/c/bndt_105c14_shp_en.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/105/c/bndt_105c14_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/bndt/50k_shp_fr/105/c/bndt_105c14_shp_fr.zip", "language": "no language | aucune langue", "format": "SHP"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "NTDB105C145.3  BNDT105C145.3"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "Designated area  Aires d\u00e9sign\u00e9es"}, {"name": "Road  Chemin"}, {"name": "Manmade features  Constructions"}, {"name": "Relief and Landforms  Relief et formes"}, {"name": "Hydrography  Hydrographie"}, {"name": "Hypsography  Hypsographie"}, {"name": "ToponymyPlace Names  ToponymieNoms de lieux"}, {"name": "Electric Network  R\u00e9seau \u00e9lectrique"}, {"name": "Railroad Network  R\u00e9seau f\u00e9rroviaire"}, {"name": "Road Network  R\u00e9seau routier"}, {"name": "Water Saturated Soils  Sols satur\u00e9s deau"}, {"name": "Vegetation  V\u00e9g\u00e9tation"}, {"name": "IRON CREEK  IRON CREEK"}, {"name": "105C14  105C14"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1983-08", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "National Topographic Data Base (NTDB)", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "2001-08", "name": "001018e4-dfce-4b20-b950-e6d97f300db8", "language": "", "url": "", "notes": "This collection is static now. Current users of the National Topographic Data Base (NTDB) should plan to make the transition towards CanVec product. The National Topographic Data Base (NTDB) comprises digital vector data sets that cover the entire Canadian landmass. Geomatics Canada has digitized and structured thousands of topographic maps, creating a complete and uniform product that can be highly useful in a broad range of industries. The NTDB includes features such as watercourses, urban areas, railways, roads, vegetation, and relief.The organizational unit for the NTDB is the National Topographic System (NTS), based on the North American Datum of 1983 (NAD83). Each file (data set) consists of one NTS unit at the 1:50,000 scale. The ground data is depicted through points, lines, and areas.", "title": "National Topographic Data Base (NTDB) - 105C14", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
{"data_series_issue_identification_fra": "1.0", "catalog_type": "Geo Data | G\\u00e9o", "title_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer - 032L01", "data_series_issue_identification": "1.0", "ready_to_publish": "0", "digital_object_identifier": "", "subject": "", "data_series_name_fra": "CanMatrix - Pr\u00eat \u00e0 imprimer", "group": "nrcan-rncan", "maintenance_and_update_frequency": "As Needed | Au besoin", "author": "Natural Resources Canada | Ressources naturelles Canada", "author_email": "geoginfo@NRCan.gc.ca", "geographic_region": "", "notes_fra": "Les fichiers CanMatrix - Pr\u00eat \u00e0 imprimer ont \u00e9t\u00e9 produits \u00e0 partir des cartes topographiques publi\u00e9es par le Gouvernement du Canada. Ces fichiers sont bas\u00e9s sur le Syst\u00e8me national de r\u00e9f\u00e9rence cartographique (SNRC) et disponibles aux \u00e9chelles de 1/50 000 et 1/250 000. Chaque fichier ou jeu de donn\u00e9es CanMatrix - Pr\u00eat \u00e0 imprimer contient l'ensemble de l'information figurant au recto de la carte topographique. Cela comprend l'information topographique incluse \u00e0 l'int\u00e9rieur de l'orle cartographique de m\u00eame que l'habillage de la carte, soit l'information situ\u00e9e en p\u00e9riph\u00e9rie de l'orle cartographique.  Les donn\u00e9es contenues dans ce fichier CanMatrix - Pr\u00eat \u00e0 imprimer proviennent du balayage d'une carte topographique papier polychrome (couleur).", "presentation_form": "Map Digital | Carte num\u00e9rique", "spatial": "{\"type\": \"Polygon\", \"coordinates\": [[[-78.5, 50], [-78.5, 50.25], [-78, 50.25], [-78, 50], [-78.5, 50]]]}", "license_id": "", "resources": [{"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/032/l/canmatrix2_032l01_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_pdf/032/l/canmatrix2_032l01_pdf.zip", "language": "no language | aucune langue", "format": "PDF"}, {"url": "http://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/032/l/canmatrix2_032l01_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}, {"url": "ftp://ftp2.cits.rncan.gc.ca/pub/canmatrix2/50k_tif/032/l/canmatrix2_032l01_tif.zip", "language": "no language | aucune langue", "format": "TIFF"}], "browse_graphic_url": "", "topic_category": "Imagery Base Maps Earth Cover  Imagerie carte de base couverture terrestre", "tags": [{"name": "CANMATRIX2032L011.0  CANMATRIX2032L011.0"}, {"name": "Earth Science  Sciences de la Terre"}, {"name": "LAC PAUL-SAUV\u00c9  LAC PAUL-SAUV\u00c9"}, {"name": "032L01  032L01"}], "endpoint_url_fra": "http://geogratis.gc.ca/api/fr/nrcan-rncan/ess-sst/", "date_published": "2010-11-02", "time_period_coverage_start": "1982", "spatial_representation_type": "Map Digital | Carte num\u00e9rique", "data_series_name": "CanMatrix - Print Ready", "endpoint_url": "http://geogratis.gc.ca/api/en/nrcan-rncan/ess-sst/", "time_period_coverage_end": "1982", "name": "001039f7-96dc-4b86-bc33-108522f75ca2", "language": "", "url": "", "notes": "CanMatrix - Print Ready files were produced from topographic maps published by the Government of Canada, and correspond to the National Topographic System (NTS) grid at 1:50 000 and 1:250 000 scales. Each CanMatrix - Print Ready file or dataset contains all of the information shown on the front of the topographic map, including the topographic information within the neatline of the map, and the information in the border of the map outside of the neatline.  This CanMatrix - Print Ready file was produced by scanning a polychrome (colour) paper topographic map.", "title": "CanMatrix - Print Ready - 032L01", "url_fra": "", "organization": "nrcan-rncan", "department_number": ""}
